script: |
  super -f text -I q11201.spq | sort > q11201.out

inputs:
  - name: q11201.spq
    data: |
      SELECT DISTINCT + col0 + - col2 / col0 * - 30 * - col1, ( - 92 ) + - col1 AS col2, + 16 FROM tab0 (FORMAT parquet) cor0 WHERE NOT NULL BETWEEN col1 + col2 AND 60 * - - col1 * - col1 - - 21;
  - name: tab0

outputs:
  - name: q11201.out
    data: |
